// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract GuardianChainRegistry {

    mapping(bytes32 => bool) private proofExists;

    event ProofRegistered(
        bytes32 indexed proofHash,
        uint256 timestamp,
        address indexed registrar
    );

    function registerProof(bytes32 proofHash) external {

        require(proofHash != bytes32(0), "Invalid hash");
        require(!proofExists[proofHash], "Proof already registered");

        proofExists[proofHash] = true;

        emit ProofRegistered(
            proofHash,
            block.timestamp,
            msg.sender
        );
    }

    function verifyProof(bytes32 proofHash) external view returns (bool) {
        return proofExists[proofHash];
    }
}

